    this.state = {
      version: 444,
      flags: 3,
      size: 2,
      checksum: 4,
      data: {},
      time: 0
    }
  };

  componentDidMount() {
    fetch('/time').then(res => res.json()).then(data => {
      setState({time: data.time});
  }, [])
